import React from 'react';
import Grid from 'react-bootstrap/es/Grid';

const About = () => (
  <Grid>
    <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
  </Grid>
);

export default About;
